import ExpenseItem from "./components/ExpenseItem";

function App() {
  return (
    <div>
      <h2>Daniel's List</h2>
      <ExpenseItem title="Item 1" amount="20"></ExpenseItem>
      <ExpenseItem title="item 2" amount="18"></ExpenseItem>
    </div>
  );
}

export default App;
